    "2016-11-25T21:06:16.365957",nt"name": "federal-pell-grant-reporting-2012-13",nt"isopen":
    true,nt"url": null,nt"notes": "Federal Pell Grant Reporting, 2012-13 (Pell
    Grant Reporting 2012-13), is a part of the Federal Pell Grant Reporting (Pell Grant
    Reporting) program. Pell Grant Reporting 2012-13 (http://www2.ed.gov/programs/fpg/index.html)
    is a compilation of quantitative program data assembled to offer insights into the
    changes to the Title IV applicant universe and the Pell Grant program. The information
    provides a basis for program planning and development and can also be used to estimate
    the potential impact of actual or proposed policies on Pell Grant recipients and
    federal aid applicants. In addition, it can assist researchers, students, higher
    education officials, and financial aid administrators to better understand current
    patterns of Federal Pell Grant disbursements and Title IV applicant activity.",nt"license_title":
